class StartupWindow(ctk.CTk):
    def __init__(self):
        super().__init__()
        self.title("LavaShell MoLava")
        self.geometry("600x400")
        self.overrideredirect(True)  # Remove window decorations
        
        # Center the window on screen
        self.update_idletasks()
        x = (self.winfo_screenwidth() // 2) - (600 // 2)
        y = (self.winfo_screenheight() // 2) - (400 // 2)
        self.geometry(f"600x400+{x}+{y}")
        
        # Variables
        self.loading_texts = [
            "Loading components...",
            "Initializing modules...",
            "Preparing interface...",
            "Almost ready...",
            "Starting LavaShell MoLava..."
        ]
        self.current_text = 0
        
        # Create UI
        self.create_widgets()
        
        # Start loading animation
        self.after(100, self.update_loading)
        
    def create_widgets(self):
        # Main frame
        main_frame = ctk.CTkFrame(self, fg_color="transparent")
        main_frame.pack(expand=True, fill="both", padx=20, pady=20)
        
        # Logo (to be set with base64)
        self.logo_label = ctk.CTkLabel(main_frame, text="", width=200, height=200)
        self.logo_label.pack(pady=(20, 10))
        
        # Loading text
        self.loading_label = ctk.CTkLabel(main_frame, text="", font=("Arial", 14))
        self.loading_label.pack(pady=10)
        
        # Progress bar
        self.progress = ctk.CTkProgressBar(main_frame, width=400, height=20)
        self.progress.pack(pady=20)
        self.progress.set(0)
        
        # Version info
        version_label = ctk.CTkLabel(main_frame, text="Version: v3\nBased on ShupXQL & SourceGet Engines\nCreated by Moein Nikchehre\nWebsite: lsi.ct.ws", 
                                    font=("Arial", 12), justify="center")
        version_label.pack(pady=10)
        
    def set_startup_logo(self, base64_logo):
        try:
            # Decode base64 image
            image_data = base64.b64decode(base64_logo)
            image = Image.open(io.BytesIO(image_data))
            
            # Resize image if needed
            image = image.resize((200, 200), Image.Resampling.LANCZOS)
            
            # Convert to CTkImage
            ctk_image = ctk.CTkImage(light_image=image, dark_image=image, size=(200, 200))
            
            # Set image to label
            self.logo_label.configure(image=ctk_image, text="")
        except Exception as e:
            print(f"Error loading startup logo: {e}")
    
    def update_loading(self):
        if self.current_text < len(self.loading_texts):
            self.loading_label.configure(text=self.loading_texts[self.current_text])
            self.current_text += 1
            progress_value = self.current_text / len(self.loading_texts)
            self.progress.set(progress_value)
            self.after(1000, self.update_loading)
        else:
            self.after(500, self.finish_startup)
    
    def finish_startup(self):
        self.destroy()
        app = MainApp()
        app.mainloop()

class MainApp(ctk.CTk):
    def __init__(self):
        super().__init__()
        self.title("LavaShell MoLava")
        self.geometry("1200x800")
        self.minsize(1000, 700)
        
        # Variables
        self.version = "v3"
        self.is_dark_mode = True
        self.current_process = None
        self.log_queue = queue.Queue()
        self.network_stats = {"sent": 0, "recv": 0}
        self.last_network_stats = psutil.net_io_counters()
        
        # Set window icon
        self.set_window_icon("")
        
        # Configure grid
        self.grid_rowconfigure(0, weight=1)
        self.grid_columnconfigure(0, weight=1)
        
        # Create tabs
        self.create_tabs()
        
        # Start background tasks
        self.after(100, self.process_log_queue)
        self.after(1000, self.update_system_stats)
        
        # Bind close event
        self.protocol("WM_DELETE_WINDOW", self.on_close)
    
    def set_window_icon(self, base64_icon):
        try:
            if base64_icon:
                # Decode base64 image
                image_data = base64.b64decode(base64_icon)
                image = Image.open(io.BytesIO(image_data))
                
                # Convert to photo image
                photo = ImageTk.PhotoImage(image)
                
                # Set window icon (method varies by platform)
                try:
                    self.iconphoto(True, photo)
                except:
                    pass
                    
                # Keep a reference to prevent garbage collection
                self.window_icon = photo
        except Exception as e:
            print(f"Error setting window icon: {e}")
    
