    def add_log(self, message):
        timestamp = datetime.now().strftime("%Y-%m-%d %H:%M:%S")
        log_message = f"[LavaShell MoLava] - {timestamp} - {message}\n"
        self.log_queue.put(log_message)
    
    def process_log_queue(self):
        try:
            while True:
                message = self.log_queue.get_nowait()
                self.log_text.configure(state="normal")
                self.log_text.insert("end", message)
                self.log_text.see("end")
                self.log_text.configure(state="disabled")
        except queue.Empty:
            pass
        finally:
            self.after(100, self.process_log_queue)
    
    def update_system_stats(self):
        # Update CPU usage
        cpu_percent = psutil.cpu_percent(interval=1)
        self.cpu_usage_label.configure(text=f"Usage: {cpu_percent}%")
        
        # Update CPU frequency
        try:
            cpu_freq = psutil.cpu_freq()
            if cpu_freq:
                self.cpu_freq_label.configure(text=f"Frequency: {cpu_freq.current/1000:.2f} GHz")
        except:
            pass
        
        # Update CPU cores
        self.cpu_cores_label.configure(text=f"Cores: {psutil.cpu_count()}")
        
        # Update RAM usage
        ram = psutil.virtual_memory()
        self.ram_usage_label.configure(text=f"Usage: {ram.percent}%")
        self.ram_total_label.configure(text=f"Total: {ram.total/(1024**3):.2f} GB")
        self.ram_used_label.configure(text=f"Used: {ram.used/(1024**3):.2f} GB")
        
        # Update network usage
        net_io = psutil.net_io_counters()
        sent_speed = (net_io.bytes_sent - self.last_network_stats.bytes_sent) / 1024
        recv_speed = (net_io.bytes_recv - self.last_network_stats.bytes_recv) / 1024
        
        self.net_sent_label.configure(text=f"Sent: {sent_speed:.2f} KB/s")
        self.net_recv_label.configure(text=f"Recv: {recv_speed:.2f} KB/s")
        
        # Update network interfaces
        interfaces = psutil.net_if_addrs()
        self.net_iface_label.configure(text=f"Interfaces: {len(interfaces)}")
        
        self.last_network_stats = net_io
        
        # Schedule next update
        self.after(1000, self.update_system_stats)
    
    def install_moshell(self):
        if self.current_process and self.current_process.is_alive():
            messagebox.showerror("Error", "A process is already running. Please wait for it to complete.")
            return
        
        if os.path.exists("C:\\cygwin64"):
            messagebox.showwarning("Warning", "Cygwin is already installed. Use the update function instead.")
            return
        
        # Show installation dialog
        self.show_installation_dialog("install")
    
    def update_moshell(self):
        if self.current_process and self.current_process.is_alive():
            messagebox.showerror("Error", "A process is already running. Please wait for it to complete.")
            return
        
        if not os.path.exists("C:\\cygwin64"):
            messagebox.showwarning("Warning", "Cygwin is not installed. Use the install function first.")
            return
        
        # Show installation dialog
        self.show_installation_dialog("update")
    
    def backup_moshell(self):
        if not os.path.exists("C:\\cygwin64\\home\\Moein"):
            messagebox.showwarning("Warning", "MoShell is not installed. Nothing to backup.")
            return
        
        # Ask for backup location
        backup_path = filedialog.asksaveasfilename(
            defaultextension=".zip",
            filetypes=[("ZIP files", "*.zip")],
            title="Select backup location"
        )
        
        if not backup_path:
            return
        
        # Start backup in thread
        self.current_process = threading.Thread(target=self.do_backup, args=(backup_path,))
        self.current_process.start()
        self.add_log(f"Starting backup to: {backup_path}")
    
    def do_backup(self, backup_path):
        try:
            with zipfile.ZipFile(backup_path, 'w', zipfile.ZIP_DEFLATED) as zipf:
                base_path = "C:\\cygwin64\\home\\Moein"
                for root, dirs, files in os.walk(base_path):
                    for file in files:
                        file_path = os.path.join(root, file)
                        arcname = os.path.relpath(file_path, base_path)
                        zipf.write(file_path, arcname)
            
            self.add_log(f"Backup completed: {backup_path}")
            self.show_notification("Backup completed successfully!", "success")
        except Exception as e:
            self.add_log(f"Backup error: {e}")
            self.show_notification(f"Backup failed: {e}", "error")
    
    def show_installation_dialog(self, mode):
        # Create dialog window
        dialog = ctk.CTkToplevel(self)
        dialog.title("Installation Options")
        dialog.geometry("400x300")
        dialog.transient(self)
        dialog.grab_set()
        
        # Center dialog
        dialog.update_idletasks()
        x = self.winfo_x() + (self.winfo_width() // 2) - (400 // 2)
        y = self.winfo_y() + (self.winfo_height() // 2) - (300 // 2)
        dialog.geometry(f"400x300+{x}+{y}")
        
        # OS selection
        ctk.CTkLabel(dialog, text="Select OS:", font=("Arial", 14)).pack(pady=10)
        os_var = ctk.StringVar(value="Windows 8.1/10/11")
